import React, {useState, useEffect} from 'react'
import { AppBar , Avatar, Button, Toolbar, Typography } from '@material-ui/core'
import memories from "../../images/memories.png"
import useStyles from './styles.js'
import {Link} from 'react-router-dom'
import { jwtDecode } from 'jwt-decode';

const Navbar = () => {

    const classes = useStyles();
    const [user, setUser] = useState(JSON.parse(localStorage.getItem("profile")))
    console.log('user')
    const decodedToken = jwtDecode(user?.result?.credential);
    console.log(decodedToken.name);



    useEffect (()=> {
        const token = user?.token;
        setUser(JSON.parse(localStorage.getItem("profile")));
    }, [])

    return(
        <AppBar className={classes.appBar} position="static" color="inherit">
            <div className={classes.brandContainer}>
            <Typography component={Link} className={classes.heading} variant="h2" align="center" > 
            Memories
        </Typography>
        <img className={classes.image} src={memories} alt="memories" height="60"/>
            </div>

            <Toolbar className={classes.toolbar}>
                {user ? (
                    <div className={classes.profile}>

                        <Avatar className={classes.purple} alt={user.result.name} src={user.result.imageUrl}>{user.result.name}</Avatar>
                        <Typography className={classes.userName} variant='h6'> {user.result.name} </Typography>
                        <Button variant="contained" className={classes.logout} color="secondary">Logout </Button>
                    </div>

                ): (
                    <Button component={Link} to='/auth' variant='contained' color="primary"> Sign In </Button>
                )}

            </Toolbar>


    </AppBar>
);
}

export default Navbar;
